import React, { Component } from 'react';
import './style/App.css';
import './style/Buttons.css';
import AppNavbar from './AppNavbar';
import { Link } from 'react-router-dom';
import { Button, Container } from 'reactstrap';

class Home extends Component {
    render() {
        return (
            <div>
                <AppNavbar />
                <Container fluid className={'app'}>
                    <Row>
                        <p className='intro_text'>Welcome to 'Calories counter'!</p>
                    </Row>
                    <Row>
                        <p className='intro_text'>This website will help you keep track of your calorie intake</p>
                    </Row>
                    <Row>
                        <Button className='start_button'><Link to="/food">Calories counter</Link></Button>
                    </Row>
                </Container>
            </div>
        );
    }
}

export default Home;
